static char __pyx_k_28[] = "airy(z)\n\nAiry functions and their derivatives.\n\nParameters\n----------\nz : float or complex\n    Argument.\n\nReturns\n-------\nAi, Aip, Bi, Bip\n    Airy functions Ai and Bi, and their derivatives Aip and Bip\n\nNotes\n-----\nThe Airy functions Ai and Bi are two independent solutions of y''(x) = x y.";
static char __pyx_k_29[] = "airye(z)\n\nExponentially scaled Airy functions and their derivatives.\n\nScaling::\n\n    eAi  = Ai  * exp(2.0/3.0*z*sqrt(z))\n    eAip = Aip * exp(2.0/3.0*z*sqrt(z))\n    eBi  = Bi  * exp(-abs((2.0/3.0*z*sqrt(z)).real))\n    eBip = Bip * exp(-abs((2.0/3.0*z*sqrt(z)).real))\n\nParameters\n----------\nz : float or complex\n    Argument.\n\nReturns\n-------\neAi, eAip, eBi, eBip\n    Airy functions Ai and Bi, and their derivatives Aip and Bip";
static char __pyx_k_30[] = "bdtr(k, n, p)\n\nBinomial distribution cumulative distribution function.\n\nSum of the terms 0 through k of the Binomial probability density.\n\n::\n\n    y = sum(nCj p**j (1-p)**(n-j),j=0..k)\n\nParameters\n----------\nk, n : int\n    Terms to include\np : float\n    Probability\n\nReturns\n-------\ny : float\n    Sum of terms";
static char __pyx_k_31[] = "bdtrc(k, n, p)\n\nBinomial distribution survival function.\n\nSum of the terms k+1 through n of the Binomial probability density\n\n::\n\n    y = sum(nCj p**j (1-p)**(n-j), j=k+1..n)\n\nParameters\n----------\nk, n : int\n    Terms to include\np : float\n    Probability\n\nReturns\n-------\ny : float\n    Sum of terms";
static char __pyx_k_32[] = "bdtri(k, n, y)\n\nInverse function to bdtr vs. p\n\nFinds probability `p` such that for the cumulative binomial\nprobability ``bdtr(k, n, p) == y``.";
static char __pyx_k_33[] = "bdtrik(y, n, p)\n\nInverse function to bdtr vs k";
static char __pyx_k_34[] = "bdtrin(k, y, p)\n\nInverse function to bdtr vs n";
