static char __pyx_k_39[] = "besselpoly(a, lmb, nu)\n\nWeighed integral of a Bessel function.\n\n.. math::\n\n   \\int_0^1 x^\\lambda J_v(\\nu, 2 a x) \\, dx\n\nwhere :math:`J_v` is a Bessel function and :math:`\\lambda=lmb`,\n:math:`\\nu=nu`.";
static char __pyx_k_40[] = "beta(a, b)\n\nBeta function.\n\n::\n\n    beta(a,b) =  gamma(a) * gamma(b) / gamma(a+b)";
static char __pyx_k_41[] = "betainc(a, b, x)\n\nIncomplete beta integral.\n\nCompute the incomplete beta integral of the arguments, evaluated\nfrom zero to x::\n\n    gamma(a+b) / (gamma(a)*gamma(b)) * integral(t**(a-1) (1-t)**(b-1), t=0..x).\n\nNotes\n-----\nThe incomplete beta is also sometimes defined without the terms\nin gamma, in which case the above definition is the so-called regularized\nincomplete beta. Under this definition, you can get the incomplete beta by\nmultiplying the result of the scipy function by beta(a, b).";
static char __pyx_k_42[] = "betaincinv(a, b, y)\n\nInverse function to beta integral.\n\nCompute x such that betainc(a,b,x) = y.";
static char __pyx_k_43[] = "betaln(a, b)\n\nNatural logarithm of absolute value of beta function.\n\nComputes ``ln(abs(beta(x)))``.";
static char __pyx_k_44[] = "binom(n, k)\n\nBinomial coefficient";
static char __pyx_k_45[] = "boxcox(x, lmbda)\n\nCompute the Box-Cox transformation.\n\nThe Box-Cox transformation is::\n\n    y = (x**lmbda - 1) / lmbda  if lmbda != 0\n        log(x)                  if lmbda == 0\n\nReturns `nan` if ``x < 0``.\nReturns `-inf` if ``x == 0`` and ``lmbda < 0``.\n\n.. versionadded:: 0.14.0\n\nParameters\n----------\nx : array_like\n    Data to be transformed.\nlmbda : array_like\n    Power parameter of the Box-Cox transform.\n\nReturns\n-------\ny : array\n    Transformed data.\n\nExamples\n--------\n>>> boxcox([1, 4, 10], 2.5)\narray([   0.        ,   12.4       ,  126.09110641])\n>>> boxcox(2, [0, 1, 2])\narray([ 0.69314718,  1.        ,  1.5       ])";
static char __pyx_k_46[] = "boxcox1p(x, lmbda)\n\nCompute the Box-Cox transformation of 1 + `x`.\n\nThe Box-Cox transformation computed by `boxcox1p` is::\n\n    y = ((1+x)**lmbda - 1) / lmbda  if lmbda != 0\n        log(1+x)                    if lmbda == 0\n\nReturns `nan` if ``x < -1``.\nReturns `-inf` if ``x == -1`` and ``lmbda < 0``.\n\n.. versionadded:: 0.14.0\n\nParameters\n----------\nx : array_like\n    Data to be transformed.\nlmbda : array_like\n    Power parameter of the Box-Cox transform.\n\nReturns\n-------\ny : array\n    Transformed data.\n\nExamples\n--------\n>> boxcox1p(1e-4, [0, 0.5, 1])\narray([  9.99950003e-05,   9.99975001e-05,   1.00000000e-04])\n>>> boxcox1p([0.01, 0.1], 0.25)\narray([ 0.00996272,  0.09645476])";
static char __pyx_k_47[] = "btdtr(a,b,x)\n\nCumulative beta distribution.\n\nReturns the area from zero to x under the beta density function::\n\n    gamma(a+b)/(gamma(a)*gamma(b)))*integral(t**(a-1) (1-t)**(b-1), t=0..x)\n\nSee Also\n--------\nbetainc";
static char __pyx_k_48[] = "btdtri(a,b,p)\n\np-th quantile of the beta distribution.\n\nThis is effectively the inverse of btdtr returning the value of x for which\n``btdtr(a,b,x) = p``\n\nSee Also\n--------\nbetaincinv";
static char __pyx_k_49[] = "btdtria(p, b, x)\n\nInverse of btdtr vs a";
static char __pyx_k_50[] = "btdtria(a, p, x)\n\nInverse of btdtr vs b";
