static char __pyx_k_66[] = "ellipj(u, m)\n\nJacobian elliptic functions\n\nCalculates the Jacobian elliptic functions of parameter m between\n0 and 1, and real u.\n\nParameters\n----------\nm, u\n    Parameters\n\nReturns\n-------\nsn, cn, dn, ph\n    The returned functions::\n\n        sn(u|m), cn(u|m), dn(u|m)\n\n    The value ``ph`` is such that if ``u = ellik(ph, m)``,\n    then ``sn(u|m) = sin(ph)`` and ``cn(u|m) = cos(ph)``.";
static char __pyx_k_67[] = "ellipkinc(phi, m)\n\nIncomplete elliptic integral of the first kind\n\n::\n\n    integral(1/sqrt(1-m*sin(t)**2),t=0..phi)";
static char __pyx_k_68[] = "ellipkm1(p)\n\nThe complete elliptic integral of the first kind around m=1.\n\nThis function is defined as\n\n.. math:: K(p) = \\int_0^{\\pi/2} [1 - m \\sin(t)^2]^{-1/2} dt\n\nwhere `m = 1 - p`.\n\nParameters\n----------\np : array_like\n    Defines the parameter of the elliptic integral as m = 1 - p.\n\nReturns\n-------\nK : array_like\n    Value of the elliptic integral.\n\nSee Also\n--------\nellipk";
static char __pyx_k_69[] = "erf(z)\n\nReturns the error function of complex argument.\n\nIt is defined as ``2/sqrt(pi)*integral(exp(-t**2), t=0..z)``.\n\nParameters\n----------\nx : ndarray\n    Input array.\n\nReturns\n-------\nres : ndarray\n    The values of the error function at the given points x.\n\nSee Also\n--------\nerfc, erfinv, erfcinv\n\nNotes\n-----\nThe cumulative of the unit normal distribution is given by\n``Phi(z) = 1/2[1 + erf(z/sqrt(2))]``.\n\nReferences\n----------\n.. [1] http://en.wikipedia.org/wiki/Error_function\n.. [2] Milton Abramowitz and Irene A. Stegun, eds.\n    Handbook of Mathematical Functions with Formulas,\n    Graphs, and Mathematical Tables. New York: Dover,\n    1972. http://www.math.sfu.ca/~cbm/aands/page_297.htm\n.. [3] Steven G. Johnson, Faddeeva W function implementation.\n   http://ab-initio.mit.edu/Faddeeva";
static char __pyx_k_70[] = "erfc(x)\n\nComplementary error function, 1 - erf(x).\n\nReferences\n----------\n.. [1] Steven G. Johnson, Faddeeva W function implementation.\n   http://ab-initio.mit.edu/Faddeeva";
