static char __pyx_k_100[] = "gamma(z)\n\nGamma function\n\nThe gamma function is often referred to as the generalized\nfactorial since ``z*gamma(z) = gamma(z+1)`` and ``gamma(n+1) =\nn!`` for natural number *n*.";
static char __pyx_k_101[] = "gammainc(a, x)\n\nIncomplete gamma function\n\nDefined as::\n\n    1 / gamma(a) * integral(exp(-t) * t**(a-1), t=0..x)\n\n`a` must be positive and `x` must be >= 0.";
static char __pyx_k_102[] = "gammaincc(a,x)\n\nComplemented incomplete gamma integral\n\nDefined as::\n\n    1 / gamma(a) * integral(exp(-t) * t**(a-1), t=x..inf) = 1 - gammainc(a,x)\n\n`a` must be positive and `x` must be >= 0.";
static char __pyx_k_103[] = "gammainccinv(a,y)\n\nInverse to gammaincc\n\nReturns `x` such that ``gammaincc(a,x) == y``.";
static char __pyx_k_104[] = "gammaincinv(a, y)\n\nInverse to gammainc\n\nReturns `x` such that ``gammainc(a, x) = y``.";
static char __pyx_k_105[] = "gammaln(z)\n\nLogarithm of absolute value of gamma function\n\nDefined as::\n\n    ln(abs(gamma(z)))\n\nSee Also\n--------\ngammasgn";
static char __pyx_k_106[] = "gammasgn(x)\n\nSign of the gamma function.\n\nSee Also\n--------\ngammaln";
static char __pyx_k_107[] = "gdtr(a,b,x)\n\nGamma distribution cumulative density function.\n\nReturns the integral from zero to x of the gamma probability\ndensity function::\n\n    a**b / gamma(b) * integral(t**(b-1) exp(-at),t=0..x).\n\nThe arguments a and b are used differently here than in other\ndefinitions.";
static char __pyx_k_108[] = "gdtrc(a,b,x)\n\nGamma distribution survival function.\n\nIntegral from x to infinity of the gamma probability density\nfunction.\n\nSee Also\n--------\ngdtr, gdtri";
static char __pyx_k_109[] = "gdtria(p, b, x, out=None)\n\nInverse of gdtr vs a.\n\nReturns the inverse with respect to the parameter `a` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution.\n\nParameters\n----------\np : array_like\n    Probability values.\nb : array_like\n    `b` parameter values of `gdtr(a, b, x)`.  `b` is the \"shape\" parameter\n    of the gamma distribution.\nx : array_like\n    Nonnegative real values, from the domain of the gamma distribution.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\na : ndarray\n    Values of the `a` parameter such that `p = gdtr(a, b, x)`.  `1/a`\n    is the \"scale\" parameter of the gamma distribution.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtrib : Inverse with respect to `b` of `gdtr(a, b, x)`.\ngdtrix : Inverse with respect to `x` of `gdtr(a, b, x)`.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtria(p, 3.4, 5.6)\n1.2";
static char __pyx_k_110[] = "gdtrib(a, p, x, out=None)\n\nInverse of gdtr vs b.\n\nReturns the inverse with respect to the parameter `b` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution.\n\nParameters\n----------\na : array_like\n    `a` parameter values of `gdtr(a, b, x)`. `1/a` is the \"scale\"\n    parameter of the gamma distribution.\np : array_like\n    Probability values.\nx : array_like\n    Nonnegative real values, from the domain of the gamma distribution.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\nb : ndarray\n    Values of the `b` parameter such that `p = gdtr(a, b, x)`.  `b` is\n    the \"shape\" parameter of the gamma distribution.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtria : Inverse with respect to `a` of `gdtr(a, b, x)`.\ngdtrix : Inverse with respect to `x` of `gdtr(a, b, x)`.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtrib(1.2, p, 5.6)\n3.3999999999723882";
static char __pyx_k_111[] = "gdtrix(a, b, p, out=None)\n\nInverse of gdtr vs x.\n\nReturns the inverse with respect to the parameter `x` of ``p =\ngdtr(a, b, x)``, the cumulative distribution function of the gamma\ndistribution. This is also known as the p'th quantile of the\ndistribution.\n\nParameters\n----------\na : array_like\n    `a` parameter values of `gdtr(a, b, x)`.  `1/a` is the \"scale\"\n    parameter of the gamma distribution.\nb : array_like\n    `b` parameter values of `gdtr(a, b, x)`.  `b` is the \"shape\" parameter\n    of the gamma distribution.\np : array_like\n    Probability values.\nout : ndarray, optional\n    If a fourth argument is given, it must be a numpy.ndarray whose size\n    matches the broadcast result of `a`, `b` and `x`.  `out` is then the\n    array returned by the function.\n\nReturns\n-------\nx : ndarray\n    Values of the `x` parameter such that `p = gdtr(a, b, x)`.\n\nSee Also\n--------\ngdtr : CDF of the gamma distribution.\ngdtria : Inverse with respect to `a` of `gdtr(a, b, x)`.\ngdtrib : Inverse with respect to `b` of `gdtr(a, b, x)`.\n\nExamples\n--------\nFirst evaluate `gdtr`.\n\n>>> p = gdtr(1.2, 3.4, 5.6)\n>>> print(p)\n0.94378087442\n\nVerify the inverse.\n\n>>> gdtrix(1.2, 3.4, p)\n5.5999999999999996";
