static char __pyx_k_149[] = "kn(n, x)\n\nModified Bessel function of the second kind of integer order n\n\nThese are also sometimes called functions of the third kind.";
static char __pyx_k_150[] = "kolmogi(p)\n\nInverse function to kolmogorov\n\nReturns y such that ``kolmogorov(y) == p``.";
static char __pyx_k_151[] = "kolmogorov(y)\n\nComplementary cumulative distribution function of Kolmogorov distribution\n\nReturns the complementary cumulative distribution function of\nKolmogorov's limiting distribution (Kn* for large n) of a\ntwo-sided test for equality between an empirical and a theoretical\ndistribution. It is equal to the (limit as n->infinity of the)\nprobability that sqrt(n) * max absolute deviation > y.";
static char __pyx_k_152[] = "kv(v,z)\n\nModified Bessel function of the second kind of real order v\n\nReturns the modified Bessel function of the second kind (sometimes\ncalled the third kind) for real order v at complex z.";
static char __pyx_k_153[] = "kve(v,z)\n\nExponentially scaled modified Bessel function of the second kind.\n\nReturns the exponentially scaled, modified Bessel function of the\nsecond kind (sometimes called the third kind) for real order v at\ncomplex z::\n\n    kve(v,z) = kv(v,z) * exp(z)";
static char __pyx_k_154[] = "log1p(x)\n\nCalculates log(1+x) for use when x is near zero";
static char __pyx_k_155[] = "log_ndtr(x)\n\nLogarithm of Gaussian cumulative distribution function\n\nReturns the log of the area under the standard Gaussian probability\ndensity function, integrated from minus infinity to x::\n\n    log(1/sqrt(2*pi) * integral(exp(-t**2 / 2), t=-inf..x))";
static char __pyx_k_156[] = "logit(x)\n\nLogit ufunc for ndarrays.\n\nThe logit function is defined as logit(p) = log(p/(1-p)).\nNote that logit(0) = -inf, logit(1) = inf, and logit(p)\nfor p<0 or p>1 yields nan.\n\n.. versionadded:: 0.10.0\n\nParameters\n----------\nx : ndarray\n    The ndarray to apply logit to element-wise.\n\nReturns\n-------\nout : ndarray\n    An ndarray of the same shape as x. Its entries\n    are logit of the corresponding entry of x.\n\nNotes\n-----\nAs a ufunc logit takes a number of optional\nkeyword arguments. For more information\nsee `ufuncs <http://docs.scipy.org/doc/numpy/reference/ufuncs.html>`_";
static char __pyx_k_157[] = "lpmv(m, v, x)\n\nAssociated legendre function of integer order.\n\nParameters\n----------\nm : int\n    Order\nv : real\n    Degree. Must be ``v>-m-1`` or ``v<m``\nx : complex\n    Argument. Must be ``|x| <= 1``.";
static char __pyx_k_158[] = "mathieu_a(m,q)\n\nCharacteristic value of even Mathieu functions\n\nReturns the characteristic value for the even solution,\n``ce_m(z,q)``, of Mathieu's equation.";
static char __pyx_k_159[] = "mathieu_b(m,q)\n\nCharacteristic value of odd Mathieu functions\n\nReturns the characteristic value for the odd solution,\n``se_m(z,q)``, of Mathieu's equation.";
static char __pyx_k_160[] = "mathieu_cem(m,q,x)\n\nEven Mathieu function and its derivative\n\nReturns the even Mathieu function, ``ce_m(x,q)``, of order m and\nparameter q evaluated at x (given in degrees).  Also returns the\nderivative with respect to x of ce_m(x,q)\n\nParameters\n----------\nm\n    Order of the function\nq\n    Parameter of the function\nx\n    Argument of the function, *given in degrees, not radians*\n\nReturns\n-------\ny\n    Value of the function\nyp\n    Value of the derivative vs x";
static char __pyx_k_161[] = "mathieu_modcem1(m, q, x)\n\nEven modified Mathieu function of the first kind and its derivative\n\nEvaluates the even modified Mathieu function of the first kind,\n``Mc1m(x,q)``, and its derivative at `x` for order m and parameter\n`q`.\n\nReturns\n-------\ny\n    Value of the function\nyp\n    Value of the derivative vs x";
static char __pyx_k_162[] = "mathieu_modcem2(m, q, x)\n\nEven modified Mathieu function of the second kind and its derivative\n\nEvaluates the even modified Mathieu function of the second kind,\nMc2m(x,q), and its derivative at x (given in degrees) for order m\nand parameter q.\n\nReturns\n-------\ny\n    Value of the function\nyp\n    Value of the derivative vs x";
static char __pyx_k_163[] = "mathieu_modsem1(m,q,x)\n\nOdd modified Mathieu function of the first kind and its derivative\n\nEvaluates the odd modified Mathieu function of the first kind,\nMs1m(x,q), and its derivative at x (given in degrees) for order m\nand parameter q.\n\nReturns\n-------\ny\n    Value of the function\nyp\n    Value of the derivative vs x";
static char __pyx_k_164[] = "mathieu_modsem2(m, q, x)\n\nOdd modified Mathieu function of the second kind and its derivative\n\nEvaluates the odd modified Mathieu function of the second kind,\nMs2m(x,q), and its derivative at x (given in degrees) for order m\nand parameter q.\n\nReturns\n-------\ny\n    Value of the function\nyp\n    Value of the derivative vs x";
static char __pyx_k_165[] = "mathieu_sem(m, q, x)\n\nOdd Mathieu function and its derivative\n\nReturns the odd Mathieu function, se_m(x,q), of order m and\nparameter q evaluated at x (given in degrees).  Also returns the\nderivative with respect to x of se_m(x,q).\n\nParameters\n----------\nm\n    Order of the function\nq\n    Parameter of the function\nx\n    Argument of the function, *given in degrees, not radians*.\n\nReturns\n-------\ny\n    Value of the function\nyp\n    Value of the derivative vs x";
static char __pyx_k_166[] = "modfresnelm(x)\n\nModified Fresnel negative integrals\n\nReturns\n-------\nfm\n    Integral ``F_-(x)``: ``integral(exp(-1j*t*t),t=x..inf)``\nkm\n    Integral ``K_-(x)``: ``1/sqrt(pi)*exp(1j*(x*x+pi/4))*fp``";
static char __pyx_k_167[] = "modfresnelp(x)\n\nModified Fresnel positive integrals\n\nReturns\n-------\nfp\n    Integral ``F_+(x)``: ``integral(exp(1j*t*t),t=x..inf)``\nkp\n    Integral ``K_+(x)``: ``1/sqrt(pi)*exp(-1j*(x*x+pi/4))*fp``";
static char __pyx_k_168[] = "modstruve(v, x)\n\nModified Struve function\n\nReturns the modified Struve function Lv(x) of order v at x, x must\nbe positive unless v is an integer.";
static char __pyx_k_169[] = "nbdtr(k, n, p)\n\nNegative binomial cumulative distribution function\n\nReturns the sum of the terms 0 through k of the negative binomial\ndistribution::\n\n    sum((n+j-1)Cj p**n (1-p)**j,j=0..k).\n\nIn a sequence of Bernoulli trials this is the probability that k\nor fewer failures precede the nth success.";
static char __pyx_k_170[] = "nbdtrc(k,n,p)\n\nNegative binomial survival function\n\nReturns the sum of the terms k+1 to infinity of the negative\nbinomial distribution.";
static char __pyx_k_171[] = "nbdtri(k, n, y)\n\nInverse of nbdtr vs p\n\nFinds the argument p such that ``nbdtr(k,n,p) = y``.";
static char __pyx_k_172[] = "nbdtrik(y,n,p)\n\nInverse of nbdtr vs k\n\nFinds the argument k such that ``nbdtr(k,n,p) = y``.";
static char __pyx_k_173[] = "nbdtrin(k,y,p)\n\nInverse of nbdtr vs n\n\nFinds the argument n such that ``nbdtr(k,n,p) = y``.";
